import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// Simple test components
const TestHome = () => (
  <div style={{ padding: '2rem', textAlign: 'center' }}>
    <h1>üè† Home Page</h1>
    <p>This is the home page - working correctly!</p>
  </div>
);

const TestProducts = () => (
  <div style={{ padding: '2rem', textAlign: 'center' }}>
    <h1>üõçÔ∏è Products Page</h1>
    <p>This is the products page - working correctly!</p>
  </div>
);

const TestCart = () => (
  <div style={{ padding: '2rem', textAlign: 'center' }}>
    <h1>üõí Cart Page</h1>
    <p>This is the cart page - working correctly!</p>
  </div>
);

const TestHeader = () => (
  <header style={{ 
    background: '#333', 
    color: 'white', 
    padding: '1rem', 
    textAlign: 'center' 
  }}>
    <h2>üëü SoleMate - Premium Shoe Store</h2>
    <nav style={{ marginTop: '1rem' }}>
      <a href="/" style={{ color: 'white', margin: '0 1rem' }}>Home</a>
      <a href="/products" style={{ color: 'white', margin: '0 1rem' }}>Products</a>
      <a href="/cart" style={{ color: 'white', margin: '0 1rem' }}>Cart</a>
    </nav>
  </header>
);

const TestFooter = () => (
  <footer style={{ 
    background: '#333', 
    color: 'white', 
    padding: '1rem', 
    textAlign: 'center',
    position: 'fixed',
    bottom: 0,
    width: '100%'
  }}>
    <p>¬© 2024 SoleMate. All rights reserved.</p>
  </footer>
);

function App() {
  return (
    <Router>
      <div className="App">
        <TestHeader />
        <main style={{ minHeight: '80vh', paddingBottom: '100px' }}>
          <Routes>
            <Route path="/" element={<TestHome />} />
            <Route path="/products" element={<TestProducts />} />
            <Route path="/cart" element={<TestCart />} />
          </Routes>
        </main>
        <TestFooter />
      </div>
    </Router>
  );
}

export default App;
